#pragma mark - Description method

- (NSString *)description {
  return [[DBPROPERTIESPropertyTypeSerializer serialize:self] description];
}

#pragma mark - Copyable method

- (instancetype)copyWithZone:(NSZone *)zone {
#pragma unused(zone)
  /// object is immutable
  return self;
}

#pragma mark - Hash method

- (NSUInteger)hash {
  NSUInteger prime = 31;
  NSUInteger result = 1;

  switch (_tag) {
  case DBPROPERTIESPropertyTypeString:
    result = prime * result + [[self tagName] hash];
  case DBPROPERTIESPropertyTypeOther:
    result = prime * result + [[self tagName] hash];
  }

  return prime * result;
}

#pragma mark - Equality method

- (BOOL)isEqual:(id)other {
  if (other == self) {
    return YES;
  }
  if (!other || ![other isKindOfClass:[self class]]) {
    return NO;
  }
  return [self isEqualToPropertyType:other];
}

- (BOOL)isEqualToPropertyType:(DBPROPERTIESPropertyType *)aPropertyType {
  if (self == aPropertyType) {
    return YES;
  }
  if (self.tag != aPropertyType.tag) {
    return NO;
  }
  switch (_tag) {
  case DBPROPERTIESPropertyTypeString:
    return [[self tagName] isEqual:[aPropertyType tagName]];
  case DBPROPERTIESPropertyTypeOther:
    return [[self tagName] isEqual:[aPropertyType tagName]];
  }
  return YES;
}

@end

#pragma mark - Serializer Object

@implementation DBPROPERTIESPropertyTypeSerializer

+ (NSDictionary *)serialize:(DBPROPERTIESPropertyType *)valueObj {
  NSMutableDictionary *jsonDict = [[NSMutableDictionary alloc] init];

  if ([valueObj isString]) {
    jsonDict[@".tag"] = @"string";
  } else if ([valueObj isOther]) {
    jsonDict[@".tag"] = @"other";
  } else {
    jsonDict[@".tag"] = @"other";
  }

  return jsonDict;
}

+ (DBPROPERTIESPropertyType *)deserialize:(NSDictionary *)valueDict {
  NSString *tag = valueDict[@".tag"];

  if ([tag isEqualToString:@"string"]) {
    return [[DBPROPERTIESPropertyType alloc] initWithString];
  } else if ([tag isEqualToString:@"other"]) {
    return [[DBPROPERTIESPropertyType alloc] initWithOther];
  } else {
    return [[DBPROPERTIESPropertyType alloc] initWithOther];
  }
}

@end
